import { ethers } from 'ethers';
import { useEffect, useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Account from "components/Account/Account";
import Chains from "components/Chains";
import Wallet from "components/Wallet";
import { Layout } from "antd";
import "./style.css";
import "antd/dist/antd.min.css";
import Home from "components/Home/Home";
import Contract from "components/Contract/Contract";
import Text from "antd/lib/typography/Text";
import MenuItems from "./components/MenuItems";
import RegisterHarvest from "components/Farmer/registerHarvest";
import RegisterCatalogue from "components/Farmer/RegisterCatalogue";
import Marketplace from "components/Marketplace/Marketplace";
import ManageOrders from "components/Marketplace/ManageOrders";
import ViewOrdersByFarmer from "components/Farmer/ViewOrdersByFarmer";
import ViewOrderByFarmer from "components/Farmer/ViewOrderByFarmer";
import ViewOrdersByCarrier from "components/Carrier/ViewOrdersByCarrier";
import ViewOrderByCarrier from "components/Carrier/ViewOrderByCarrier";
import ScanProduct from "components/Customer/ScanProduct";
// import Footer from "components/Footer";

import "components/static/antMotionStyle.less";

import Order from "components/Marketplace/Order";

import BrowseHarvest from "components/Farmer/BrowseHarvest";
import FarmerProfile from "components/Farmer/FarmerProfile";
import { useWeb3, Web3Provider } from "./contexts/Web3Context";

const { Header, Footer } = Layout;

const styles = {
  content: {
    display: "flex",
    justifyContent: "center",
    fontFamily: "Roboto, sans-serif",
    color: "#041836",
    marginTop: "130px",
    padding: "10px",
  },
  header: {
    position: "fixed",
    zIndex: 1,
    width: "100%",
    background: "#fff",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    fontFamily: "Roboto, sans-serif",
    borderBottom: "2px solid rgba(0, 0, 0, 0.06)",
    padding: "0 10px",
    boxShadow: "0 1px 10px rgb(151 164 175 / 10%)",
  },
  headerRight: {
    display: "flex",
    gap: "20px",
    alignItems: "center",
    fontSize: "15px",
    fontWeight: "600",
  },
};
const App = () => {
  const { roleType } = useWeb3();
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [account, setAccount] = useState(null);
  const [provider, setProvider] = useState(null);
  // Add roleType state
  const [localRoleType, setRoleType] = useState(null);

  useEffect(() => {
    const initProvider = async () => {
      if (window.ethereum) {
        const provider = new ethers.providers.Web3Provider(window.ethereum);
        setProvider(provider);

        const accounts = await provider.listAccounts();
        if (accounts.length > 0) {
          setAccount(accounts[0]);
          setIsAuthenticated(true);
        }
      }
    };
    initProvider();
  }, []);

  return (
    <Layout style={{ height: "100vh", overflow: "auto" }}>
      <Router>
        <Header roleType={roleType || localRoleType} style={styles.header}>
          <Logo />
          {/* Only render MenuItems here, remove it from Account component */}
          <MenuItems roleType={roleType || localRoleType} />
          <div style={styles.headerRight}>
            <Chains />
            {(roleType || localRoleType) && (roleType || localRoleType).toUpperCase()}
            <Account setRoleType={setRoleType} />
          </div>
        </Header>

        <div className="content" style={{ margin: "100px 200px" }}>
          <Switch>
            <Route exact path="/home">
              <Home />
            </Route>
            <Route path="/wallet">
              <Wallet />
            </Route>
            <Route path="/registerHarvest">
              <RegisterHarvest />
            </Route>
            <Route path="/browseHarvest">
              <BrowseHarvest />
            </Route>
            <Route path="/registerCatalogue">
              <RegisterCatalogue />
            </Route>
            <Route path="/Marketplace">
              <Marketplace />
            </Route>
            <Route path="/orders">
              <ManageOrders />
            </Route>
            <Route path="/farmer/orders">
              <ViewOrdersByFarmer />
            </Route>
            <Route path="/farmer/order/:order_id">
              <ViewOrderByFarmer />
            </Route>
            <Route path="/carrier/orders">
              <ViewOrdersByCarrier />
            </Route>
            <Route path="/carrier/order/:order_id">
              <ViewOrderByCarrier />
            </Route>
            <Route path="/order/:order_id">
              <Order />
            </Route>
            <Route path="/scanproduct/:order_id">
              <ScanProduct />
            </Route>
            <Route path="/scanproduct">
              <ScanProduct />
            </Route>
            <Route path="/FarmerProfile">
              <FarmerProfile />
            </Route>
            <Route path="/contract">
              {isAuthenticated ? (
                <Contract />
              ) : (
                <>Please login using the "Authenticate" button</>
              )}
            </Route>
            <Route path="/">
              <Redirect to="/home" />
            </Route>
            <Route path="/nonauthenticated">
              <>Please login using the "Authenticate" button</>
            </Route>
          </Switch>
        </div>
      </Router>
      <Footer style={{ textAlign: "center" }}>
        <Text style={{ display: "block" }}>Daliah Blockchain | PSUT</Text>
      </Footer>
    </Layout>
  );
};

